sys_variable_value.value:
(function execute(inputs, outputs) {
	try {
		var inputsPayload = {};
		inputsPayload.errorMsg = inputs.errormsg;
		inputsPayload.aliasId = inputs.aliasid;
		inputsPayload.statusCode = inputs.statuscode;
		inputsPayload.errorCode = inputs.errorcode;
		inputsPayload.restStepStatusCode = inputs.reststepstatuscode;
		inputsPayload.restStepStatusMessage = inputs.reststepstatusmessage;
		inputsPayload.errorSource = "Env0 Connect";

		var acceptableStatusCodes = [200];

//		sn_devops.DevOpsErrorHelper.validateRESTStep(inputsPayload, sn_devops.DevOpsCommonMessages.TOOL_NOT_CONNECTED, acceptableStatusCodes);

//		var result = new DevOpsJenkinsIntegrationHandler().interpretConnectResponse(inputs.statuscode, inputs.errormsg);
		if (inputs.statuscode == "200" ) {
			outputs.responsebody = inputs.responseBody;
		} else {
			outputs.responsebody = '{}';
		}
		outputs.errorMessage = "Error Connecting";

	} catch (ex) {
		var devopsError = sn_devops.DevOpsErrorHelper.createDevOpsActionScriptError(ex, sn_devops.DevOpsCommonMessages.TOOL_NOT_CONNECTED_ISSUE, "Env0 Connect");
		throw sn_devops.DevOpsErrorHelper.stringify(devopsError);
	}

})(inputs, outputs);

